import React from "react";
import ReactDOM from "react-dom";
import $ from "jquery";
import Page from "./Page";
import "./Stylesheet.css";


var elemJSON = { data: null };

$(document).ready(function () {
    var xmlHttp = new XMLHttpRequest();

    xmlHttp.onreadystatechange = function () {
        if (xmlHttp.readyState === 4 && xmlHttp.status === 200) {
            elemJSON.data = JSON.parse(xmlHttp.responseText);
        }
    };

    xmlHttp.open("GET", "./Elements.json", true);
    xmlHttp.send();

    ReactDOM.render(<Page json={elemJSON} />, document.getElementById("main"));

    $("#temperatureSlider").val(273);
    $("#temperatureInput").val(273);
    $("#temperatureSlider").trigger("change");
});
